INSERT INTO `innovations` (`id`, `title`, `body`, `img`, `category`, `type`, `language`, `tags`, `author`, `created_at`, `updated_at`) VALUES
(1, 'Primera idea con editor nuevo', '<p>test</p>', 'https://images.unsplash.com/photo-1553356043-87636630a106?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1050&q=80', 'homeandpets', NULL, 'de', NULL, 'showme', '2019-04-27 07:09:56', '2019-04-27 07:09:56'),
(2, 'Segunda idea genial', '<p>Editor de texto rich</p>', 'https://images.unsplash.com/photo-1553356043-87636630a106?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1050&q=80', 'homeandpets', NULL, 'de', NULL, 'showme', '2019-04-27 08:05:46', '2019-04-27 08:05:46'),
(3, 'Idea hermosa creada con VueJS', '<h1>Meet DHTMLX Rich Text Editor!</h1><p>This demo will show you the main features of our highly customizable JavaScript rich text editor.</p><p>Type in any text here, apply text formatting and use the controls below to change the editor\'s look and feel and convert your text into HTML, markdown or plain text.</p><p><strong>To learn more, read our </strong><a href=\"https://docs.dhtmlx.com/richtext/index.html\" title=\"documentation\"><strong>documentation</strong></a><strong> and check the </strong><a href=\"https://docs.dhtmlx.com/richtext/samples/\" title=\"samples\"><strong>samples</strong></a></p><blockquote><p>It\'s extremely easy and fast to build a fully working nice-looking application that normally would take weeks or months to build.</p></blockquote><p style=\"text-align: right;\"><a href=\"https://www.g2crowd.com/products/dhtmlxsuite/reviews\" title=\"G2Crowd\">G2Crowd</a></p>', 'https://images.unsplash.com/photo-1493612276216-ee3925520721?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=700&q=80', 'improvethis', NULL, 'msa', NULL, 'showme', '2019-05-01 04:03:28', '2019-05-01 04:03:28');
INSERT INTO `innovations` (`id`, `title`, `body`, `img`, `category`, `type`, `language`, `tags`, `author`, `created_at`, `updated_at`) VALUES
(4, 'Vamos de nuevo', '<h1>Meet DHTMLX Rich Text Editor!</h1><p>This demo will show you the main features of our highly customizable JavaScript rich text editor.</p><p>Type in any text here, apply text formatting and use the controls below to change the editor\'s look and feel and convert your text into HTML, markdown or plain text.</p><p><strong>To learn more, read our </strong><a href=\"https://docs.dhtmlx.com/richtext/index.html\" title=\"documentation\"><strong>documentation</strong></a><strong> and check the </strong><a href=\"https://docs.dhtmlx.com/richtext/samples/\" title=\"samples\"><strong>samples</strong></a></p><blockquote><p>It\'s extremely easy and fast to build a fully working nice-looking application that normally would take weeks or months to build.</p></blockquote><p style=\"text-align: right;\"><a href=\"https://www.g2crowd.com/products/dhtmlxsuite/reviews\" title=\"G2Crowd\">G2Crowd</a><img src=\"data:image/png;base64,\" data-filename=\"28577281_552073105177496_5835945572369292046_n.png\" style=\"width: 492px;\"></p>', 'https://images.unsplash.com/photo-1507668077129-56e32842fceb?ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=60', 'improvethis', NULL, 'en', NULL, 'showme', '2019-05-01 04:15:53', '2019-05-01 04:15:53');

